/* Theme: elegantNavy */
@theme reference {
  --color-elegantNavy-background: 0 0% 100%;
  --color-elegantNavy-foreground: 0 0% 3.9%;
  --color-elegantNavy-card: 0 0% 100%;
  --color-elegantNavy-card-foreground: 0 0% 3.9%;
  --color-elegantNavy-popover: 0 0% 100%;
  --color-elegantNavy-popover-foreground: 0 0% 3.9%;
  --color-elegantNavy-primary: 226 71% 40%;
  --color-elegantNavy-primary-foreground: 0 0% 98%;
  --color-elegantNavy-secondary: 214 100% 97%;
  --color-elegantNavy-secondary-foreground: 0 0% 9%;
  --color-elegantNavy-muted: 210 40% 96%;
  --color-elegantNavy-muted-foreground: 0 0% 45.1%;
  --color-elegantNavy-accent: 214 95% 93%;
  --color-elegantNavy-accent-foreground: 0 0% 9%;
  --color-elegantNavy-destructive: 0 72% 51%;
  --color-elegantNavy-destructive-foreground: 0 0% 100%;
  --color-elegantNavy-border: 214 32% 91%;
  --color-elegantNavy-input: 214 32% 91%;
  --color-elegantNavy-ring: 226 71% 40%;
}

.theme-elegantNavy {
  --color-background: var(--color-elegantNavy-background);
  --color-foreground: var(--color-elegantNavy-foreground);
  --color-card: var(--color-elegantNavy-card);
  --color-card-foreground: var(--color-elegantNavy-card-foreground);
  --color-popover: var(--color-elegantNavy-popover);
  --color-popover-foreground: var(--color-elegantNavy-popover-foreground);
  --color-primary: var(--color-elegantNavy-primary);
  --color-primary-foreground: var(--color-elegantNavy-primary-foreground);
  --color-secondary: var(--color-elegantNavy-secondary);
  --color-secondary-foreground: var(--color-elegantNavy-secondary-foreground);
  --color-muted: var(--color-elegantNavy-muted);
  --color-muted-foreground: var(--color-elegantNavy-muted-foreground);
  --color-accent: var(--color-elegantNavy-accent);
  --color-accent-foreground: var(--color-elegantNavy-accent-foreground);
  --color-destructive: var(--color-elegantNavy-destructive);
  --color-destructive-foreground: var(--color-elegantNavy-destructive-foreground);
  --color-border: var(--color-elegantNavy-border);
  --color-input: var(--color-elegantNavy-input);
  --color-ring: var(--color-elegantNavy-ring);
}

@media (prefers-color-scheme: dark) {
  .theme-elegantNavy {
    --color-background: 240 10% 3.9%;
    --color-foreground: 0 0% 98%;
    --color-card: 240 10% 3.9%;
    --color-card-foreground: 0 0% 98%;
    --color-popover: 240 10% 3.9%;
    --color-popover-foreground: 0 0% 98%;
    --color-primary: 226 71% 80%;
    --color-primary-foreground: 240 5.9% 10%;
    --color-secondary: 240 3.7% 15.9%;
    --color-secondary-foreground: 0 0% 98%;
    --color-muted: 240 3.7% 15.9%;
    --color-muted-foreground: 240 5% 64.9%;
    --color-accent: 214 95% 33%;
    --color-accent-foreground: 0 0% 98%;
    --color-destructive: 0 62.8% 30.6%;
    --color-destructive-foreground: 0 0% 98%;
    --color-border: 240 3.7% 15.9%;
    --color-input: 240 3.7% 15.9%;
    --color-ring: 226 71% 80%;
  }
}

